import React from 'react';
import img1 from '../Images/pic1.jpg';
import img2 from '../Images/pic2.jpg';
import img3 from '../Images/pic3.jpg';

export default function Portfolio() {
  return (
    <div className='bg-[#8173B2]'>
      <div className='flex flex-col justify-center items-center space-y-4 py-8'>
        <p className='text-yellow-500 text-xl'>Our Portfolio</p>
        <div className='font-bold text-6xl space-x-2 flex flex-row'>
          <span>STEP INTO</span>
          <span className='text-yellow-500'>STYLE</span>
        </div>
        <div className='my-4 space-x-6 text-white'>
          <button className="bg-[#9987D6] text-white px-4 py-2 rounded-2xl font-bold">High Heels</button>
          <button className="bg-[#9987D6] text-white px-4 py-2 rounded-2xl font-bold">Sneakers</button>
          <button className="bg-[#9987D6] text-white px-4 py-2 rounded-2xl font-bold">Flat Sandals</button>
          <button className="bg-[#9987D6] text-white px-4 py-2 rounded-2xl font-bold">Wedding Flats</button>
        </div>
      </div>
      <div className='flex justify-center items-center space-x-4 my-4'>
        <div className='w-80 h-80 lg:flex lg:bg-cover bg-center bg-no-repeat rounded-lg' style={{ backgroundImage: `url(${img1})` }}></div>
        <div className='w-80 h-80 lg:flex lg:bg-cover bg-center bg-no-repeat rounded-lg' style={{ backgroundImage: `url(${img2})` }}></div>
        <div className='w-80 h-80 lg:flex lg:bg-cover bg-center bg-no-repeat rounded-lg' style={{ backgroundImage: `url(${img3})` }}></div>
      </div>
    </div>
  );
}
